import React from 'react';

const dogDetails = props => {
  let { dog } = this.props;
  return (
    <div className='DogDtails row'>
      <div className='col-11 col-5-lg'>
        <div className='DogDetails-card card'>
          <img src={dog.src} alt={dog.name}/>
        </div>
      </div>
    </div>
  )
}

export default dogDetails;
